// --- Embedded polygons ---
const polygons = [
  {
    "type":"Polygon",
    "coordinates":[[[50.513762751477316,26.284159953024307],[50.48833834693074,26.167868525007435],[50.59115352136071,26.092116452233554],[50.69508625203475,26.086847097771734],[50.70709998165567,26.157587186129827],[50.64954583509958,26.19269045957514],[50.62440081961403,26.222519927028625],[50.60735808689601,26.24056429536525],[50.60487522001838,26.246951006205443],[50.60253376101531,26.249838533386544],[50.59121281835363,26.254221432297424],[50.584229091681564,26.263234439337992],[50.513762751477316,26.284159953024307]]]
  },
  {
    "type":"Polygon",
    "coordinates":[[[50.721115177442336,26.166270741455726],[50.81585682324011,26.222992288184535],[50.637606602353294,26.365265547020716],[50.5093670233765,26.31193353431502],[50.582230887495946,26.278334800114862],[50.57993124026075,26.270161542995485],[50.588042723235795,26.26000040721323],[50.59368731190403,26.25415078927667],[50.602342347861544,26.25073837610391],[50.60343924489858,26.249298702598033],[50.6059407052146,26.246155353451257],[50.62619100854814,26.223542439835303],[50.62790275223869,26.219867992464945],[50.638234348086364,26.213067216553092],[50.66531827676812,26.1847915400568],[50.721115177442336,26.166270741455726]]]
  }
];

// --- Base maps ---
const osm = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', { attribution: '&copy; OpenStreetMap contributors' });
const googleRoads = L.tileLayer('https://{s}.google.com/vt/lyrs=m&x={x}&y={y}&z={z}', { subdomains:['mt0','mt1','mt2','mt3'], attribution: '&copy; Google' });
const googleHybrid = L.tileLayer('https://{s}.google.com/vt/lyrs=y&x={x}&y={y}&z={z}', { subdomains:['mt0','mt1','mt2','mt3'], attribution: '&copy; Google' });
const dark = L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', { attribution: '&copy; OSM & CARTO', subdomains: 'abcd', maxZoom: 19 });

const map = L.map('map', { layers: [osm] }).setView([26.22, 50.58], 12);
L.control.layers({ "OpenStreetMap": osm, "Google Roads": googleRoads, "Google Hybrid": googleHybrid, "Dark": dark }).addTo(map);

let openTooltip = null;

// Determine marker color
function getPointColor(lat, lng) {
  const pt = turf.point([lng, lat]);
  if (turf.booleanPointInPolygon(pt, polygons[0])) return "green";
  if (turf.booleanPointInPolygon(pt, polygons[1])) return "blue";
  return "gray";
}

// Marker creation
function rowToMarker(row) {
  const lat = parseFloat(row.latitude ?? row.lat ?? row.Latitude ?? row.Lat);
  const lng = parseFloat(row.longitude ?? row.lng ?? row.Longitude ?? row.Lng);
  if (!Number.isFinite(lat) || !Number.isFinite(lng)) return null;

  const binId = row.BinID ?? row.id ?? '';
  const linkVal = row.Link ?? row.link ?? '';
  const linkHTML = linkVal ? `<a href="${linkVal}" target="_blank" rel="noopener">Open Link</a>` : '(no link)';
  const tooltipHTML = `<div class="custom-tooltip"><div class="tt-close" onclick="closeTooltip()"></div>Bin ID: ${binId}<br>${linkHTML}</div>`;

  const color = getPointColor(lat, lng);
  const marker = L.circleMarker([lat, lng], { radius: 6, color: color, fillColor: color, fillOpacity: 0.9 });

  marker.on('click', () => {
    if (openTooltip) { openTooltip.closeTooltip(); openTooltip = null; }
    marker.bindTooltip(tooltipHTML, { permanent: true, direction: 'top', className: 'custom-tooltip', interactive: true }).openTooltip();
    openTooltip = marker;
  });

  return marker;
}

function closeTooltip() { if (openTooltip) { openTooltip.closeTooltip(); openTooltip = null; } }

// Cluster layer with color matching
const clusterLayer = L.markerClusterGroup({
  iconCreateFunction: function(cluster) {
    const markers = cluster.getAllChildMarkers();
    let greenCount = 0, blueCount = 0;
    markers.forEach(m => {
      const color = m.options.fillColor;
      if(color==='green') greenCount++;
      if(color==='blue') blueCount++;
    });
    let clusterColor = 'gray';
    if(greenCount >= blueCount && greenCount>0) clusterColor='green';
    else if(blueCount > greenCount) clusterColor='blue';

    return L.divIcon({
      html: `<div style="background-color:${clusterColor}; border-radius:50%; width:30px; height:30px; display:flex; align-items:center; justify-content:center;">${cluster.getChildCount()}</div>`,
      className: 'custom-cluster-icon',
      iconSize: [30,30]
    });
  }
});
map.addLayer(clusterLayer);

// Add markers
const markers = embeddedData.map(rowToMarker).filter(Boolean);
clusterLayer.addLayers(markers);
if(markers.length) map.fitBounds(L.latLngBounds(markers.map(m => m.getLatLng())));

// Invisible polygons (for Turf checks)
polygons.forEach((f) => {
  L.geoJSON(f, { opacity: 0, fillOpacity: 0 }).addTo(map);
});
